import React, { Component } from 'react';
import axios from 'axios';
class Coba extends Component {
  constructor() {
    super();
    this.state = {
      ticker: "",
    };
  } componentDidMount(){
  axios.get("https://indodax.com/api/ticker/btcidr")
  .then((ambilData) => {
    console.log(ambilData);
    this.setState({
        get1: ambilData.data.ticker.high,
        get2: ambilData.data.ticker.low,
        get3: ambilData.data.ticker.vol_btc,
        get4: ambilData.data.ticker.vol_idr,
        get5: ambilData.data.ticker.last,
        get6: ambilData.data.ticker.buy,
        get7: ambilData.data.ticker.sell,
        get8: ambilData.data.ticker.server_time,

    }) 
  })
};
render() {
    return (
      <div>
        <center>
          <h1>Coba Get Data</h1>
          <p>high = {this.state.get1}</p>
          <p>low = {this.state.get2}</p>
          <p>vol_btc = {this.state.get3}</p>
          <p>vol_idr = {this.state.get4}</p>
          <p>last = {this.state.get5}</p>
          <p>buy = {this.state.get6}</p>
          <p>sell = {this.state.get7}</p>
          <p>server_time = {this.state.get8}</p>

        </center>
      </div>
    );
  }
}
export default Coba;
